const books = [
  {
    title: "The Design of Everyday Things",
    author: "Don Norman",
    alreadyRead: false,
    image:
      "data:image/jpeg;base64,"
  },
  {
    title: "The Most Human Human",
    author: "Brian Christian",
    alreadyRead: true,
    image:
      "data:image/jpeg;base64,"
  },
  {
    title: "Solve for happy",
    author: "Mo Gawdat",
    alreadyRead: true,
    image:
      "data:image/jpeg;base64,"
  }
];

let listOfbooks = document.createElement("ul");

books.forEach(book => {
  let newLi = document.createTextNode(`I want ${book.author}`);
  let bookLi = document.createElement("li");
  bookLi.style.backgroundColor = book.alreadyRead ? "green" : "red";
  let newImg = document.createElement("img");
  newImg.setAttribute("src", book.image);
  bookLi.appendChild(newLi);
  listOfbooks.appendChild(bookLi);
  listOfbooks.appendChild(newImg);
});

document.body.appendChild(listOfbooks);
